import { useState, useEffect } from "react";

const MostrarProducto = () => {
  const [data, setData] = useState();

  useEffect(() => {
    fetch("http://localhost:3001/single_product/")
      .then((res) => res.json())
      .then((data) => setData(data));
  }, []);
  console.log(data);
  return <p>{data}</p>;
};

export default MostrarProducto;
